            param:{
                type:type,
                search:search,
            },
        }))
    }

    ordersDetail(ordersID){
        return axios.get('http://localhost:9527/system/ordersSys/selectOrders?ordersID='+ordersID)
    }
    delOrders(ordersID){
        return axios.get(urlPrefix+'/ordersSys/delOrders?ordersID='+ordersID)
